import react from "react"
import reactDOM from "react-dom/client"
import './style.css'
import one_image from './assets/images/Product1.jpeg'
import two_image from './assets/images/Product2.jpeg'
import three_image from './assets/images/Product3.jpeg'
const root=reactDOM.createRoot(document.getElementById("root"));

// creating navbar component
function Navbar()
{
  return(
    <div className="navbar">
      <h1>Perfumy</h1>
      <ul>
        <li>Home</li>
        <li>Products</li>
        <li>About</li>
        <li>Contact</li>
      </ul>
    </div>
  )
}

function Searchbar()
{
  return(
    <div className="search_bar">
      <input type="text" placeholder="Search" />
    </div>
  );
}

function Products(){
  return( 
    <div className="products">
      <div className="product_one">
        <img src={one_image}alt="" />
        <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>
      </div>
      <div className="product_two">
        <img src={two_image}alt="" />
        <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>
      </div>
      <div className="product_three">
        <img src={three_image}alt="" />
        <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>
      </div>

    </div>
  );
}

// About component
function About()
{
  return(
    <div className="about_us">
      <h1>About Us</h1>
      <p> Lorem ipsum dolor sit amet consectetur adipisicing elit. Dignissimos est ad, laboriosam aspernatur itaque officiis vel magnam, nulla doloribus excepturi qui perspiciatis possimus soluta quasi laborum. Placeat, temporibus vitae! Dolor.</p>
    </div>
  )
}

// footer component
function Footer()
{
  return(
    <div className="footer">
      <div>
      <h1>Contact</h1>
      <h1>+91 12345678</h1>
      <h1>Perfumy@gmail.com</h1>
      </div>
    </div>
  )
}



root.render(<div>
  <Navbar> </Navbar>
  <Searchbar></Searchbar>
  <Products></Products>
  <About></About>
</div>)
